import React from "react";
import InvoiceList from "./components/InvoiceList";
app.use(cors({ origin: "http://localhost:8080" }));


function App() {
  return (
    <div>
      <h1>Invoice Generator</h1>
      <InvoiceList />
    </div>
  );
}

export default App;
